css:
@keyframes bracket-animation {
  from {
    border-color: #656c72;
  }
  40% {
    border-color: rgba(29, 31, 33, 0.615);
  }
  to {
    border-color: rgba(29, 31, 33, 0.45);
  }
}
atom-text-editor.editor .bracket-matcher .region {
  animation: bracket-animation 0.85s;
  border: 1px solid rgba(29, 31, 33, 0.45);
}
